import React from 'react';
import { Card , Button, CardBody} from 'reactstrap';
import { withNamespaces } from "react-i18next";

const SubmitProject = () => {
    return(

             <React.Fragment>
             <div className="page-content">
                 <Container fluid>

                     {/* Render Breadcrumb */}
                     <Breadcrumbs title={props.t('Project')} breadcrumbItem={props.t('All Project')} />

                     <Row>
                         <Col lg="12">
                             <ProjectList />
                         </Col>
                     </Row>
                 </Container>
             </div>
         </React.Fragment>
    )
}

export default withNamespaces()(SubmitProject)
